// src/Footer.js
import React from "react";
import "./Footer.css";

const Footer = () => {
  const year = new Date().getFullYear();
  return (
    <footer className="app-footer">
      &copy; {year} RATE RIGHT. All rights reserved.
    </footer>
  );
};

export default Footer;
